window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author Brett Battles comes the latest in his award-winning Jonathan Quinn thriller series. </p> <p>Jonathan Quinn has had better years, but now most of the trouble is behind him, if not forgotten. </p> <p>There is one issue that remains unresolved - the break between him and his partner, Nate. Quinn has come to accept the only potential path to healing the wound is via the passage of time. </p> <p>The secret world has other ideas. </p> <p>Quinn and his girlfriend, Orlando, are hired for a new mission, but they must include on their team the operative who is one of the few to have ever seen the face of the jobâ€™s target. This operative is unknown to the client, but not to Quinn and Orlando. </p> <p>Now, to stop a plan that could slaughter tens of thousands of people, they must turn to the one person who wants nothing to do with them. </p> <p>If they can even find him in time.</p>"; 
